import React, {FC} from "react";
import { IGoods } from "../../../types/types";

interface MyCheckboxProps {
    key: string;
    producer: any;
    onClick: any;
}

const MyCheckbox:FC<MyCheckboxProps> = ({producer, onClick}) => {
    let producerName = producer[0];
    return (
        <div>
            <input 
                type="checkbox" 
                name={producerName}
                onClick={ (event) => onClick( {producerName} ) }
            />
            <label htmlFor={producerName}>{producer[0]} ({producer[1]})</label>
        </div>

    );
};

export default MyCheckbox
